var seed;
var link;
var answer;
var message;
var information;
var score;

function start(){
    seed = Math.floor(Math.random()*db.length)
    const queryString = window.location.search;
    if(queryString.length > 0){
        const urlParams = new URLSearchParams(queryString);
        seed = parseInt(urlParams.get('id'));
    }
    link = db[seed];
    answer = extractNumber(link);
    var embedded = document.getElementById("embed");
    embedded.src = removeTitle(link);
}

function removeTitle(input){
    const regex = /title=(.*?)setup=/;
    const result = input.replace(regex, 'title=CuberGuessr' + seed + '&setup=');
    return result;
}

function extractNumber(input) {
    const regex = /result:\s*([\d.]+)\s*sec/;
    const match = regex.exec(input);
    if (match && match[1]) {
      return parseFloat(match[1]);
    }
    return null;
}  

function check(){
    var guess = parseFloat(document.getElementById('input').value);
    score = parseInt(5000 - (Math.abs(answer-guess) / answer) * 10000);
    if (score < 0) score = 0;
    information = "The correct answer is " + answer + ". Your guess of " + guess + " gave a score of " + score + "/5000.";
    message = "";
    if(guess < answer * 1.03 &&  guess > answer * .97){
        message = "Amazing!";
    }
    else if(guess < answer * 1.10 &&  guess > answer * .90){
        message = "Great!";
    }
    else if(guess < answer * 1.25 &&  guess > answer * .75){
        message = "Good!";
    }
    else if(guess < answer * 1.5 &&  guess > answer * .5){
        message = "Not bad";
    }
    else{
        message = "Bruh";
    }
    document.getElementById("finalMessage").innerHTML = message;
    document.getElementById("information").innerHTML = information;
    document.getElementById("statsModal").style.display = "block";
    document.getElementById('input').disabled = true;
}

function source(){
    window.open(link,'_blank');
}

function share(){
    clipboard = "CuberGuessr #" + seed + " " + score + "/5000" + '\n';
    clipboard += "samuelfang.github.io/CuberGuessr/index.html?id=" + seed;
    navigator.clipboard.writeText(clipboard);
}